@import url('https://fonts.googleapis.com/css2?family=Abril+Fatface&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Playfair+Display:ital,wght@0,400;0,500;0,600;0,700;1,400;1,500;1,600;1,700&display=swap');

@font-face {
    font-family: 'Neue Montreal Regular';
    src: url('../fonts/neue-montreal/NeueMontreal-Regular.otf') format('otf');
}
@font-face {
    font-family: 'Neue Montreal Light';
    src: url('../fonts/neue-montreal/NeueMontreal-Light.otf') format('otf');
}


// Font
$text-font: 'Neue Montreal Regular', sans-serif;
$text-font-light : 'Neue Montreal Light', sans-serif;
$title-font: 'Abril Fatface', sans-serif;
$third-font: 'Playfair Display', serif;

// Color
$white-color: #FFFFFF;
// $black-color: #0e0e0e;
$black-color: #111111;
$green-color: #5fcf77;

sources.assets\\styles\\base.scss:
@import './variables.scss';
@import './breakpoints.scss';

* {
    margin: 0;
    box-sizing: border-box;
    &:after,
    &:before {
        box-sizing: border-box;
    }
}

* {
    scrollbar-width: thin;
}

/* Works on Chrome, Edge, and Safari */
*::-webkit-scrollbar {
    width: 10px;
    background-color: rgb(53, 52, 52);
    border-radius: 20px;

}

*::-webkit-scrollbar-thumb:hover {
    border: 1px solid rgb(56, 56, 56);
}

*::-webkit-scrollbar-thumb {
    background-color: rgb(35, 35, 35);
    border-radius: 20px;
    border: 1px solid rgb(40, 40, 40);
}

html,
body {
    overflow-x: hidden;
    scroll-behavior: smooth;

    @include mobile {
        scroll-behavior: initial;
    }
}

body {
    background-color: #000;
    color: $white-color;
    font-family: $text-font-light;
    line-height: 1.5;
    -webkit-font-smoothing: antialiased;
}

button,
input,
textarea,
select {
    font: inherit;
}

p,
h1,
h2,
h3,
h4,
h5,
h6 {
    overflow-wrap: break-word;
}

img,
video,
canvas,
svg {
    max-width: 100%;
}

a {
    text-decoration: none;
    color: inherit;
}
ul {
    list-style: none;
    display: block;
    margin-block-start: 0;
    margin-block-end: 0;
    margin-inline-start: 0px;
    margin-inline-end: 0px;
    padding-inline-start: 0;
}
.bigHover {
    user-select: none; /* -- Prevent image highlighting -- */
}

:target {
    @include mobile {
        scroll-margin-top: 50px;
    }
}

.cursor {
    @include mobile {
        display: none;
    }
}

sources.assets\\styles\\breakpoints.scss:
$breakpoints: (
    "desktop": 1024px,
    "tablet": 768px,
    "mobile": 480px,
);

@mixin desktop {
    @media screen and (max-width: map-get($breakpoints, "desktop")) {
        @content;
    }
}

@mixin tablet {
    @media screen and (max-width: map-get($breakpoints, "tablet")) {
        @content;
    }
}

@mixin mobile {
    @media screen and (max-width: map-get($breakpoints, "mobile")) {
        @content;
    }
}

sources.assets\\styles\\loader.scss:
@import './variables.scss';
@import './breakpoints.scss';

.loader {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    height: 100vh;
    width: 100%;
    z-index: 99;
    background: #000;
    display: grid;
    place-items: center;
    font-family: $text-font;
    font-weight: 300;

    // display: none;

    &__box {
        position: relative;
        width: 500px;
        height: 200px;
        @media (max-width: 780px) {
            & {
                width: 90vw;
            } 
        }
    }
    &__bar {
        width: 40%;
        height: 9px;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        background: $white-color;
        border-radius: 10px;
        cursor: pointer;
        //Media queries
        @include tablet {
            width: 25%;
        } 
        @include mobile {
            width: 40%;
        } 
    }
    &__bar--inner {
        height: 100%;
        width: 0;
        border-radius: 10px;
        opacity: 0.7;
        background-image: radial-gradient(circle at left, rgb(71, 71, 71),rgb(8, 8, 8));
    }
    //Available
    &__text--container {
        position: relative;
        top: -65px;
        cursor: pointer;

        //Media queries
        @include tablet {
            top: -55px;
        }
    }

    &__border {
       width: 90%;
       height: 1px; 
       background: $white-color;
       position: absolute;
       left: 50%;
       transform: translatex(-50%);
    }
    &__counter {
        position: absolute;
        margin-top: 75px;
        color: $white-color;
        font-family: $title-font;
        font-size: 18px;
        font-weight: 300;
        font-style: italic;
        cursor: default;

        //Media queries
        @include tablet {
            font-size: 14px;
            margin-bottom: 25px;
        } 
        @include mobile {
            font-size: 12px;
            margin-bottom: 25px;
        }
    }
    &__counter.active {
        animation: counterScale 0.5s linear forwards;
        @keyframes counterScale {
            from {
                scale: 1;
            }
            to {
                scale: (var(--vw-scale)); 
            }
        }  
    }
}

.slash {
    font-weight: bold;
    animation: pulse 1s ease-in-out infinite;
    @keyframes pulse {
       from {
        opacity: 0;
       } 
       to {
        opacity: 1;
       }
    }
}


.layout {
    width: calc(100vw - 85%);
    height: 100vh;
    position: absolute;
    right: calc(100vw - 148%);
    opacity: 0.3;
    background-image: linear-gradient(to right, $black-color, rgb(71, 71, 71), $black-color);
}

.background {
    position: absolute;
    width: 500px;
    height: 150px;
    border: 3px solid $white-color;
    border-radius: 50%;
    visibility: hidden;
    cursor: default;

    &__svg {
        position: absolute;
        top: 50%;
        left: 50%;
        width: 100%;
        transform: translate(-50%, -50%);
        opacity: 0;
    }
}


// Background noise animation
.opacity__overlay {
    background: $black-color;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: -1;
    opacity: 0.5;
}
.noise::before {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    content: "";
    opacity: 0.1;
    z-index: -1;
    pointer-events: none;
    background: url("../images/noise400.gif");
}

