@import "./breakpoints.scss";

// Mouse animation

.cursor {
    pointer-events: none;
    position: fixed;
    display: block;
    border-radius: 0;
    mix-blend-mode: difference;
    top: 0;
    left: 0;
    z-index: 9999;
    

    // Media queriess
    @include tablet {
        display: none;
    }
}
  
.circle {
    position: absolute;
    display: block;
    width: 24px;
    height: 24px;
    border-radius: 20px;
    background-color: #FFFFFF;
}

//AVAILABLE STATE
.available {
    position: absolute;   
    top: 6rem;
    white-space: nowrap;
    left: 50%;
    transform: translateX(-50%);

    //Media queries 
    @include tablet {
        transform: translateX(-50%) scale(0.8);
    }
    @include mobile {
        transform: translateX(-50%) scale(0.7);
    }

    &__border {
        width: 280px;
        overflow: hidden;
        border: solid 1px $white-color;
        padding: 0.5rem 3rem;
        display: flex;
        line-break: none;
        border-radius: 50px;
        cursor: pointer;
    }

    &__text {           
        position: relative;
        top: 1px;
        right: 57px;
        font-size: 0.9rem;
        animation: moveleft 9s linear infinite;
    }
}

.available p {
    display: inline-block;
}

.dots {
    width: 8px;
    height: 8px;
    background-color: #bfff07;
    display: inline-block;
    border-radius: 50px;
    position: relative;
    top: -1px;
    left: 4px;
}
  
.landing {
    position: relative;
    width: 100%;
    height: 100vh;
    color: $white-color;
    overflow: hidden;
    z-index: 2;
    .header {
        position: absolute;
        left: 50%;
        transform: translateX(-50%);
        width: 100%;
        z-index: 10;
        
        // Media queries
        @include mobile {
            position: fixed;
            width: 100%;
            height: 55px;
            background-color: $black-color;
        }
        &__name {
            position: absolute;
            left: 40px;
            font-size: 19px;
            padding-top: 18px;
            // Media queries
            @include mobile {
                padding-top: 18px;
            }
        }
        &__wrapper {
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 10px;
            width: 100%;
            padding-top: 20px;

            @include tablet {
                padding-top: 28px;
            }

            @include mobile {
                display: none;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                padding: 0;
                z-index: 99;
                width: 100vw;
                height: 100vh;
                background: $black-color;
                position: absolute;
                padding: 0;
                top: -1200px;
                border-bottom: 1px solid $white-color;
            }
        }
        &__wrapper.active {
            display: flex;
            overflow-y: hidden;
            margin-top: 0;
            animation: dropDown 1s ease-in-out forwards;
            z-index: 99;

            @keyframes dropDown {
                to {
                    top: 0;
                }
            }
        }
        &__wrapper.remove {
            animation: removeDropDown 1s ease-in-out forwards;

            @keyframes removeDropDown {
                from {
                    top: 0;
                }
                to {
                    top: -1200px;
                }
            }
        }
        &__closeDropDown {
            position: absolute;
            right: 20px;
            top: 17px;
            font-size: 19px;
            font-weight: 300;
            visibility: hidden;
            @include mobile {
                visibility: visible;
            }
        }
        &__left {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 2rem;
            & li {
                font-size: 18px;
                font-weight: 700;
            }

            // Media queries
            @include desktop {
                gap: 1rem;
            }
            @include tablet {
                position: absolute;
                right: 81px;
                gap: 0.7rem;
            }
            @include mobile {
                flex-direction: column;
                position: initial;
                padding: 0;
            }
        }
        &__left a {
            //Media queries
            @include mobile {
                font-size: 30px;
            }
        }
        &__right {
            position: absolute;
            right: 50px;

            // Media queries
            @include mobile {
                display: flex;
                justify-content: center;
                position: relative;
                width: 100%;
            }
        }
        &__border {
            height: 1px;
            background-color: $white-color;
            width: 100vw;
            position: absolute;
