    @include desktop {
        transform: translateX(-50%) scale(1);
    } 
    @include tablet {
        transform: translateX(-50%) scale(0.9);
    }
    @include mobile {
        transform: translateX(-50%) scale(0.8);
    }
}

.scrollDown {
    position: absolute;
    bottom: 3rem;
    left: 50%;
    bottom: 20px;
    opacity: 0.8;
    transform: translateX(-50%);
    z-index: 1;
    cursor: pointer;

    //Media queries
    @include desktop {
        transform: translateX(-50%) scale(0.95);
    }
    @include tablet {
        transform: translateX(-50%) scale(0.9);
    }
    @include mobile {
        transform: translateX(-50%) scale(0.8);
    }

