@import './breakpoints.scss';

// Navbar links animation
.animatedLinks {
    position: relative;
    display: grid;
    place-items: center;
    overflow: hidden;
    font-weight: 300;
    font-size: 17px;

    // Media queries
    @include desktop {
        font-size: 15px;
    }
    @include tablet {
        font-size: 12.5px;
    }
    @include mobile {
        font-size: 50px;
    }
    &:before {
        content: "";
        position: absolute;
        bottom: 2px;
        left: 0;
        width: 100%;
        height: 1px;
        background-color: currentColor;
        transform: scale3d(0, 1, 1);
        transform-origin: right;
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:after {
       content: attr(data-text);
       position: absolute;
       bottom: 2px;
       height: 100%;
       transform: translate3d(150%, 0, 0);
       font-family: $third-font;
       font-size: 18px;

        // Media queries
        @include desktop {
            font-size: 16px;
        }
        @include tablet {
            font-size: 13.2px;
            bottom: 3px;
        }
        @include mobile {
            font-size: 30px;
        }
    }
    & span {
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:hover:before {
        transform: scale3d(1, 1, 1);
        transform-origin: left;
    }
    &:hover:after {
        transform: translate3d(0, 0, 0);
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:hover span {
        transform: translate3d(-150%, 0, 0);
    }
}

// Navbar name animation
.animatedMail {
    position: relative;
    display: grid;
    overflow: hidden;
    width: 180%;
    font-family: $text-font;
    cursor: pointer;

    // Media queries
    @include desktop {
        font-size: 17px;
        right: 20px;
    }
    @include tablet {
        font-size: 13px;
        right: 30px;
    }
    @include mobile {
        font-size: 17px;
        right: 20px;
        bottom: 2px;
    }
    &:before {
        content: "";
        position: absolute;
        bottom: 0;
        left: 0;
        width: 100%;
        transform: scale3d(0, 1, 1);
        transform-origin: right;
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:after {
       content: attr(data-text);
       position: absolute;
       width: 49%;
       top: 0;
       right: -10px;
       height: 100%; 
       transform: translate3d(100%, 0, 0);
       transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
       opacity: 0.7;
       font-family: $text-font-light;

       //Media queries
       @include desktop {
            display: none;
        }
        @include mobile {
            display: block;
            width: 49%;
        }
    }    
    & span {
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:hover:before {
        transform: scale3d(1, 1, 1);
        transform-origin: left;
    }
    &:hover:after {
        transform: translate3d(0, 0, 0);
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
        transform-origin: right;       
    }
    &:hover span {
        transform: translate3d(-100%, 0, 0);
    }
}

// Navbar contact button
.animatedButton {
    position: relative;
    display: grid;
    place-items: center;
    overflow: hidden;
    left: 15px;
    border: none;
    cursor: pointer;
    background: none;
    color: $white-color;
    font-size: 17px;
    font-weight: 300;
    height: 55px;

    // Media queries
    @include desktop {
        font-size: 15px;
        height: 50px;
        left: 35px;
    }
    @include tablet {
        font-size: 12.5px;
        left: 45px;
    }
    @include mobile {
        font-size: 30px;
        height: auto;
        margin-top: 14px;
    }
    &:before {
        content: "";
        position: absolute;
        bottom: 0;
        left: 0;
        width: 100%;
        background-color: currentColor;
        transform: scale3d(0, 1, 1);
        transform-origin: right;
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:after {
       content: attr(data-text);
       position: absolute;
       top: 0;
       height: 100%; 
       transform: translate3d(220%, 0, 0);
       font-size: 35px;

       //Media queries
       @include mobile {
        display: none;
       }

    // Media queries 
    @include desktop {
        font-size: 32px;
    }
    @include tablet {
        font-size: 25px;
        top: 7px;
    }
    @include mobile {
        top: 0;
        font-size: 40px;
    }
    }
    & span {
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:hover:before {
        transform: scale3d(1, 1, 1);
        transform-origin: left;
    }
    &:hover:after {
        transform: translate3d(0, 0, 0);
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
        animation: jump-shaking 0.7s 0.3s ease-in-out;
        @keyframes jump-shaking {
            0% { transform: translateX(0) }
            25% { transform: translateY(-5px) }
            35% { transform: translateY(-5px) rotate(17deg) }
            55% { transform: translateY(-5px) rotate(-17deg) }
            65% { transform: translateY(-5px) rotate(17deg) }
            75% { transform: translateY(-5px) rotate(-17deg) }
            100% { transform: translateY(0) rotate(0) }
          }
    }
    &:hover span {
        transform: translate3d(-220%, 0, 0);

        @include mobile {
            transform: translate(0);
        }
    }
}



// Styled text introduction
span.media__text {
    font-size: 35px;
    font-family: $third-font;

    // Media queries
    @include desktop {
        font-size: 30px;
    }
